INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 0, 324, 1, 4, "リリ", 40011, 24001, 125801, 2);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 0, 325, 1, 5, "クリア", 40011, 24001, 126001, 2);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("お兄。\nきてくれて、うれしい", 2, 0, 326, 1, 6, "プレシア", 40011, 24001, 126101, 2);
